-- ----------------------------
--  View definition for `ec_l2_cakey_view`
-- ----------------------------
DROP VIEW IF EXISTS `ec_l2_cakey_view`;
CREATE ALGORITHM=UNDEFINED DEFINER=`root`@`localhost` SQL SECURITY DEFINER VIEW `ec_l2_cakey_view` AS select `tb`.`reportTime` AS `reportTime`,`tb`.`status` AS `status`,count(1) AS `total` from (select `ta`.`op_type` AS `status`,date_format(`ta`.`create_time`,'%Y-%m-%d') AS `reportTime` from `casums_db`.`ec_cakey_order_detail` `ta`) `tb` group by `tb`.`reportTime`,`tb`.`status`;

-- ----------------------------
--  View definition for `ec_user_view`
-- ----------------------------
DROP VIEW IF EXISTS `ec_user_view`;
CREATE ALGORITHM=UNDEFINED DEFINER=`root`@`localhost` SQL SECURITY DEFINER VIEW `ec_user_view` AS select `t`.`alias` AS `alias`,`t`.`name` AS `name`,`t`.`email` AS `email`,`t`.`password` AS `password`,`t`.`idcard` AS `idcard`,`t`.`mobile` AS `mobile`,(case when (`t`.`status` = 'y') then 0 else 1 end) AS `disabled`,(case when (`t`.`pwd_expire_time` > now()) then 0 else 1 end) AS `expired` from `ec_user` `t`;

